HQ rare promo music video from a promo DVD. My Iron Lung is the third extended play (EP) by English alternative rock group Radiohead, released in October 1994. The title track later appeared on the band's second studio album The Bends (1995). The EP also contains outtakes from then ongoing recording sessions for The Bends, compiling songs that were issued as B sides on two separate &quot;My Iron Lung&quot; CD singles in the UK and other markets. My Iron Lung was originally released in EP form with all eight songs only in Australia, but it is currently in print worldwide.

The record is seen as a bridge between the relative simplicity of their 1993 debut album Pablo Honey, and the greater sonic depth of Radiohead's later work, beginning with The Bends. The &quot;My Iron Lung&quot; single charted at number 24 in the UK. It received little radio or MTV attention in the United States.

The song &quot;My Iron Lung&quot; was recorded live, in the same 1994 London concert filmed for Live at the Astoria, with only singer Thom Yorke later overdubbed. The song as it appears on the 1994 singles/EP is virtually identical to the version that appeared the next year on The Bends, with only some barely audible changes in mixing levels.

&quot;My Iron Lung&quot; was Radiohead's reaction to &quot;Creep&quot;, their massive hit of 1993 which also became something of a millstone for Yorke. The song's caustic, self reflexive lyrics used the iron lung as a metaphor for the way &quot;Creep&quot; had both sustained the band's life and constrained them (&quot;this is our new song / just like the last one / a total waste of time / my iron lung&quot;). An acoustic version of &quot;Creep&quot; itself appears at the end of the EP.

Radiohead are an English rock band from Abingdon, Oxfordshire, formed in 1985. The band consists of Thom Yorke (lead vocals, guitar, piano), Jonny Greenwood (lead guitar, keyboards, other instruments), Colin Greenwood (bass), Phil Selway (drums, percussion), and Ed O'Brien (guitar, backing vocals).

Radiohead released their debut single &quot;Creep&quot; in 1992. The song was initially unsuccessful, but it became a worldwide hit several months after the release of their debut album, Pablo Honey (1993). Radiohead's popularity rose in the United Kingdom with the release of their second album, The Bends (1995). Radiohead's third album, OK Computer (1997), propelled them to greater international fame. Featuring an expansive sound and themes of modern alienation, OK Computer is often acclaimed as one of the landmark records of the 1990s.[

Radiohead have sold more than 30 million albums worldwide, with the band's work being placed highly in both listener polls and critics' lists; they have the distinction of doing so in both the 1990s and 2000s. In 2005, Radiohead were ranked number 73 in Rolling Stone's list of &quot;The Greatest Artists of All Time&quot;, while Jonny Greenwood (48th) and Ed O'Brien were both included in Rolling Stone's list of greatest guitarists, and Thom Yorke (66th) in their list of greatest singers. In 2009, Rolling Stone readers voted the group the second best artist of the 2000s.
